              import React, { useState, useEffect } from 'react';
              import { useRouter } from 'next/router';
              
              function ProjectCard({ title, description, image, technologies }) {
                const [isHovered, setIsHovered] = useState(false);
                
                return (
                  <div 
                    className="card" 
                    onMouseEnter={() => setIsHovered(true)}
                    onMouseLeave={() => setIsHovered(false)}
                  >
                    <img src={image || "/placeholder.svg"} alt={title} />
                    <h3>{title}</h3>
                    <p>{description}</p>
                    <div className="technologies">
                      {technologies.map(tech => (
                        <span key={tech}>{tech}</span>
                      ))}
                    </div>
                    {isHovered && (
                      <div className="overlay">
                        <button>View Project</button>
                      </div>
                    )}
                  </div>
                );
              }
              
              export default function Projects() {
                const [projects, setProjects] = useState([]);
                
                useEffect(() => {
                  // Fetch projects data
                  async function fetchProjects() {
                    const res = await fetch('/api/projects');
                    const data = await res.json();
                    setProjects(data);
                  }
                  
                  fetchProjects();
                }, []);
                
                return (
                  <section className="projects-section">
                    <h2>My Projects</h2>
                    <div className="projects-grid">
                      {projects.map(project => (
                        <ProjectCard key={project.id} {...project} />
                      ))}
                    </div>
                  </section>
                );
              }
            `})})}),(0,a.jsxs)("div",{className:"container mx-auto px-4 relative z-10",children:[(0,a.jsxs)("div",{className:"text-center mb-12",children:[(0,a.jsxs)("h2",{className:"text-2xl md:text-3xl font-bold mb-2 relative inline-block",children:["My Projects",(0,a.jsx)("div",{className:"absolute -bottom-2 left-0 w-full h-1 bg-[#58a6ff]",children:(0,a.jsx)("div",{className:"absolute top-0 left-0 h-full w-1/3 bg-white animate-pulse"})})]}),(0,a.jsx)("p",{className:"mt-6 text-sm text-[#8b949e] max-w-2xl mx-auto",children:"Here are some of the projects I've worked on. You can filter them by category."})]}),(0,a.jsx)("div",{className:"flex justify-center mb-8 animate-on-scroll opacity-0",children:(0,a.jsxs)("div",{className:"inline-flex p-1 bg-[#161b22] rounded-lg relative overflow-hidden",children:[(0,a.jsx)("div",{className:"absolute inset-0 bg-gradient-to-r from-[#58a6ff]/10 via-transparent to-[#58a6ff]/10 animate-gradient-x"}),(0,a.jsx)(ex,{variant:"all"===t?"default":"ghost",onClick:()=>r("all"),className:"all"===t?"bg-[#238636] hover:bg-[#2ea043] relative z-10":"hover:bg-[#30363d] relative z-10",size:"sm",children:"All"}),(0,a.jsx)(ex,{variant:"frontend"===t?"default":"ghost",onClick:()=>r("frontend"),className:"frontend"===t?"bg-[#238636] hover:bg-[#2ea043] relative z-10":"hover:bg-[#30363d] relative z-10",size:"sm",children:"Frontend"}),(0,a.jsx)(ex,{variant:"backend"===t?"default":"ghost",onClick:()=>r("backend"),className:"backend"===t?"bg-[#238636] hover:bg-[#2ea043] relative z-10":"hover:bg-[#30363d] relative z-10",size:"sm",children:"Backend"}),(0,a.jsx)(ex,{variant:"fullstack"===t?"default":"ghost",onClick:()=>r("fullstack"),className:"fullstack"===t?"bg-[#238636] hover:bg-[#2ea043] relative z-10":"hover:bg-[#30363d] relative z-10",size:"sm",children:"Full Stack"})]})}),(0,a.jsx)("div",{className:"grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6",children:i.map((e,t)=>(0,a.jsx)("div",{className:"animate-on-scroll opacity-0",style:{animationDelay:`